import styled from 'styled-components';

export const Form = styled.form`
  background-color: #4654e1;
  width: 300px;
  height: 40px;
  border-radius: 5px;
  display: flex;
  flex-direction: row;
  align-items: center;
`;

export const Input = styled.input`
  all: unset;
  font: 16px system-ui;
  color: #fff;
  height: 100%;
  width: 100%;
  padding: 6px 10px;
`;

export const Button = styled.button`
  all: unset;
  cursor: pointer;
  width: 44px;
  height: 44px;
`;

export const Svg = styled.svg`
  color: #fff;
  fill: currentColor;
  width: 24px;
  height: 24px;
`;
